var isSorted = function(arr, comp){
    var sorted = true;
    for (var i = 1; i < arr.length; i++){
        if (getVal(arr[i],comp) < getVal(arr[i-1],comp)){
            sorted = false;
        }
    }
    return true;
};
var getVal = function(obj, sortBy){
    switch(sortBy){
      case 'title':
        return obj.title.toLowerCase();
      case 'album':
        return obj.album.toLowerCase();
      case 'artist':
        return obj.artist.toLowerCase();
      case 'playcount':
        return obj.playcount;
    }
  };